const solve = (input) => {

    var array = new Array(...input);
 
    for(let index =0; index<array.length; index++){
        if(index != 0){
            if(array[index].charCodeAt(0) == array[index-1].charCodeAt(0) - 32 ||
                array[index].charCodeAt(0) == array[index-1].charCodeAt(0) + 32){
                array.splice(index-1,2);
                index=-1;
            }
        }
    }
    return array.length;

}


